import logo from './logo.svg';
import "materialize-css/dist/css/materialize.min.css"
import './App.css';
import NavBar from './Components/NavBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar />
      </header>
    </div>
  );
}

export default App;
